import React from 'react';
import { Container, Row } from 'react-bootstrap';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

const Home = () => {
    return (
        <Container>
            <Row>
                <Card style={{ width: '18rem' }}>
                    <Card.Img variant="top" href="holder.js/100px180" />
                    <Card.Body>
                        <Button variant="primary">Взять собаку</Button>
                    </Card.Body>
                </Card>

                <Card style={{ width: '18rem' }}>
                    <Card.Img variant="top" href="holder.js/100px180" />
                    <Card.Body>
                        <Button variant="primary">Взять кошку</Button>
                    </Card.Body>
                </Card>
            </Row>
            <Row>
                <Button>Отдать питомца</Button>
                <Button>Помочь приюту</Button>
            </Row>
        </Container>
    );
};

export default Home;
